import React , {Component} from 'react';
import './App.css';
import { BrowserRouter , Route, Switch} from 'react-router-dom'
import MainPage from '../src/components/MainPage'
import Home from '../src/components/Home'
import Mounting from '../src/components/Mounting'
import Updateting from '../src/components/Updateting'
import Unmounting from '../src/components/Unmounting'

class App extends Component{
    constructor(props) {
        super(props)
    }
    render() {
        return(
            <BrowserRouter>
                <MainPage/>
                <Switch>
                    <Route path='/' component={Home}/>
                    <Route path='/mounting' component={Mounting}/>
                    <Route Path='/updating' component={Updating} />
                    <Route Path='unmounting' component={Unmounting} />
                </Switch>
            </BrowserRouter>
        )
    }

}

export default App;
